import React, { Component } from "react";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { logoutUser } from "../../actions/authActions";
class Dashboard extends Component {
  onLogoutClick = e => {
    e.preventDefault();
    this.props.logoutUser();
  };
render() {
    const { user } = this.props.auth;
return (
  <header>
 
    <ul id="dropdown1" class="dropdown-content">
      <li><a href="#!">Logout</a></li>
    </ul>
    <div class="navbar-fixed">
      <nav class="red darken-1">
        <div class="container">
          <div class="nav-wrapper">
            <a href="#!" class="brand-logo">Title</a>
            
            <a href="#" data-target="nav-mobile" class="sidenav-trigger"><i class="material-icons">menu</i></a>
            <ul class="right">
              <li><a class="waves-effect waves-light">Login<i class="material-icons right">account_box</i></a></li>
              <li><span id="txt3">ID</span><i class="material-icons right">stay_primary_landscape</i></li>
              <li><a class="dropdown-trigger" href="#!" data-target="dropdown1">Hello User<i class="material-icons right">arrow_drop_down</i></a></li>
            </ul>
          </div>
        </div>
      </nav>
    </div>

</header>
    );
  }
}
Dashboard.propTypes = {
  logoutUser: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired
};
const mapStateToProps = state => ({
  auth: state.auth
});
export default connect(
  mapStateToProps,
  { logoutUser }
)(Dashboard);
